import React from "react";
import ReactDOM from 'react-dom';
 
function Time() {
    const myElement = (
        <div>
            <h2 className="-mt-72 text-sm">Today's Date : <b>{new Date().toDateString()}</b> | Current Time : <b>{new Date().toLocaleTimeString()}</b></h2>
        </div>
    );
 
    ReactDOM.render(
        myElement,
        document.getElementById("roots")
    );
}
 
setInterval(Time, 1000);
 
export default Time;
